import YouTube from 'react-youtube'

const Videos = () => {
  const opts = {
    height: '390',
    width: '640',
    playerVars: {
      // https://developers.google.com/youtube/player_parameters
      autoplay: 1,
    }
  }

  const onReady = (e) => { e.target.pauseVideo }

  return (
    <div>
      <p>Videos</p>
      <YouTube videoId='JG1Bc-uj5jI' opts={opts} onReady={onReady} />
    </div>
  )
}

export default Videos
